attributes.css:
.canvasPage h1, .canvasPage h2, .canvasPage h3, .canvasPage h4, .canvasPage h5, .canvasPage h6, .canvasPage li, .canvasPage p, .canvasPage th, .canvasPage td {
}

.canvasPage h1, .canvasPage h2 {
font-weight: 400;
}

.canvasPage h2 {
text-transform: uppercase;
color: #1785B0;
}

.canvasMarkdown p,
.canvasMarkdown li {
font-size: 18px;
}

.canvasMarkdown li {
margin-bottom: .75em;
}

.canvasMarkdown h3:not(:first-child) {
margin-top: 2em;
}

.canvasMarkdown a {
color: #1785B0;
}

.canvasMarkdown th,
.canvasMarkdown td {
padding: .5em 1em;
}

.canvasMarkdown th {
background-color: #FAFBFD;
}

.canvasMarkdown table,
.canvasMarkdown th,
.canvasMarkdown td {
border: 1px solid #e4e9f2;
}

elements.expression:
filters
| essql query="
    SELECT ID.keyword 
    FROM \"issues_github\""
| markdown 
  "# Item Updates

The following slides provide an up-to-date summary of the \"ORG\" Github project Board.

There are currently **{{rows.length}}** active issues.

Use the Dropdowns below to choose a theme / status to filter data contained in this report, or leave as 'ANY' to view all." 
  font={font family="'Gill Sans', 'Lucida Grande', 'Lucida Sans Unicode', Verdana, Helvetica, Arial, sans-serif" size=24 align="left" color="#FFFFFF" weight="normal" underline=false italic=false}
| render 
  css=".canvasMarkdown h1 {
color: #00AEEF;
}

.canvasMarkdown p {
color: #00395d;
}

.canvasMarkdown h5 {
color: #FFFFFF;
font-weight: 300;
font-size: .75em;
margin-top: 2em;
font-style: italic;
}"

esdocs index="github_barclays-view" fields="Theme.keyword"
| dropdownControl valueColumn="Theme.keyword" filterColumn=null
| render containerStyle={containerStyle padding="0px" border="0px inset #86d2ed"} css=".canvasRenderEl{

}"

